using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace RPGmap
{
    internal class Program
    {
        static string[][] currentMap = new string[40][];
        static string[][] map_Overworld = new string[40][];
        static string[][] map_Underworld = new string[40][];
        static string[][] map_HouseA = new string[40][];

        static string[][] map_newMap = new string[5][];

        static string[] walkables = new string[3];

        static bool gameOver;
        static ConsoleKeyInfo choice;
        static string world;

        static int x;
        static int y;

        static char character;
        static void Main(string[] args)

        {
            Console.SetWindowSize(122, 40);
            Console.SetBufferSize(Console.WindowWidth, Console.WindowHeight);

            InitMap_Overworld();
            InitMap_Underworld();
            InitMap_HouseA();

            currentMap = map_Overworld;
            world = "overworld";

            walkables = new string[] { " ", "▒", "▀" };

            gameOver = false;
            x = 5;
            y = 5;
            character = (char)1;

            Console.CursorVisible = false;

            DrawMap();


            while (gameOver == false)
            {
                //Console.Clear();
                //DrawMap();
                PlayerDraw(x, y);
                PlayerUpdate();
            }
        }

        static void DrawMap()
        {

            for (int mapX = 0; mapX < currentMap.Length; mapX++)
            {
                Console.SetCursorPosition(0, mapX);
                for (int mapY = 0; mapY < currentMap[mapX].Length; mapY++)
                {
                    Console.Write(currentMap[mapX][mapY]);
                }

            }

        }

        static void PlayerDraw(int x, int y)
        {
            Console.SetCursorPosition(x, y);
            Console.WriteLine(character);
        }

        static void PlayerUpdate()
        {
            bool isWalkable;
            string destination = " ";

            choice = Console.ReadKey(true);

            Console.SetCursorPosition(x, y);
            Console.Write(currentMap[y][x]);

            switch (choice.Key)
            {
                case ConsoleKey.Escape:
                    gameOver = true;
                    break;

                case ConsoleKey.W:
                    destination = currentMap[y - 1][x];
                    isWalkable = CheckWalkable(destination);

                    if (isWalkable == true)
                    {
                        y--;
                        break;
                    }
                    else
                    {
                        break;
                    }

                case ConsoleKey.S:
                    destination = currentMap[y + 1][x];
                    isWalkable = CheckWalkable(destination);

                    if (isWalkable == true)
                    {
                        y++;
                        break;
                    }
                    else
                    {
                        break;
                    }

                case ConsoleKey.A:
                    destination = currentMap[y][x - 1];
                    isWalkable = CheckWalkable(destination);

                    if (isWalkable == true)
                    {
                        x--;
                        break;
                    }
                    else
                    {
                        break;
                    }

                case ConsoleKey.D:
                    destination = currentMap[y][x + 1];
                    isWalkable = CheckWalkable(destination);

                    if (isWalkable == true)
                    {
                        x++;
                        break;
                    }
                    else
                    {
                        break;
                    }
                default:
                    {
                        break;
                    }
            }

            CheckForDoor();
        }

        static bool CheckWalkable(string destination)
        {
            bool goTime = false;

            foreach (string walkable in walkables)
            {
                if (destination == walkable)
                {
                    goTime = true;
                }
            }

            return goTime;
        }

        static void CheckForDoor()
        {
            switch (world)
            {
                case "overworld":
                    if (x == 5 && y == 4)
                    {
                        currentMap = map_HouseA;
                        world = "houseA";
                        Console.SetCursorPosition(0, 0);
                        DrawMap();

                        x = 59;
                        y = 25;

                        PlayerDraw(x, y);
                    }
                    break;

                case "houseA":
                    if (x == 59 && y == 26)
                    {
                        currentMap = map_Overworld;
                        world = "overworld";
                        Console.SetCursorPosition(0, 0);
                        DrawMap();

                        x = 5;
                        y = 5;

                        PlayerDraw(x, y);
                    }
                    break;


            }

        }
        static void InitMap_newMap()
        {
            map_newMap[0] = new string[] { " ", " ", " ", " ", " " };
            map_newMap[1] = new string[] { " ", " ", " ", " ", " " };
            map_newMap[2] = new string[] { " ", " ", " ", " ", " " };
            map_newMap[3] = new string[] { " ", " ", " ", " ", " " };
            map_newMap[4] = new string[] { " ", " ", " ", " ", " " };
        }


